            children: "3.9. \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u043E \u043C\u043E\u0436\u0435\u0442 \u0441\u043E\u0431\u0438\u0440\u0430\u0442\u044C \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u0443\u044E \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E, \u043A\u043E\u0433\u0434\u0430 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043F\u043E\u0441\u0435\u0449\u0430\u0435\u0442 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u044B \u0438\u043B\u0438 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u0442 \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0435 \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u0438\xA0\u0443\u0441\u043B\u0443\u0433\u0438 \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0430. \u0421\u044E\u0434\u0430 \u0432\u0445\u043E\u0434\u0438\u0442 \u0442\u0430\u043A\u0430\u044F \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044F, \u043A\u0430\u043A IP-\u0430\u0434\u0440\u0435\u0441, \u0442\u0438\u043F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u0435\u043C\u043E\u0433\u043E \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430, \u043E\u043F\u0435\u0440\u0430\u0446\u0438\u043E\u043D\u043D\u0430\u044F \u0441\u0438\u0441\u0442\u0435\u043C\u0430 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430 \u0438\xA0\u0442\u0438\u043F \u0431\u0440\u0430\u0443\u0437\u0435\u0440\u0430, \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0439 \u0438\u0434\u0435\u043D\u0442\u0438\u0444\u0438\u043A\u0430\u0442\u043E\u0440 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432\u0430, \u0430\u0434\u0440\u0435\u0441 \u0441\u0441\u044B\u043B\u0430\u044E\u0449\u0438\u0445\u0441\u044F \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u043E\u0432, \u043F\u0443\u0442\u044C, \u043F\u043E\xA0\u043A\u043E\u0442\u043E\u0440\u043E\u043C\u0443 \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044C \u043F\u0440\u043E\u0445\u043E\u0434\u0438\u0442 \u0447\u0435\u0440\u0435\u0437 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u044B \u0438\xA0\u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0435 \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0430, \u0438\xA0\u0442\u0430\u043A \u0434\u0430\u043B\u0435\u0435. \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u043E \u043C\u043E\u0436\u0435\u0442 \u0442\u0430\u043A\u0436\u0435 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u044C \u0442\u0430\u043A\u0438\u0435 \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0438\u0438, \u043A\u0430\u043A \u0444\u0430\u0439\u043B\u044B cookie, \u0432\u0435\u0431-\u043C\u0430\u044F\u043A\u0438 \u0438\xA0\u0438\u0434\u0435\u043D\u0442\u0438\u0444\u0438\u043A\u0430\u0442\u043E\u0440\u044B \u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0443\u0441\u0442\u0440\u043E\u0439\u0441\u0442\u0432, \u0434\u043B\u044F \u0441\u0431\u043E\u0440\u0430 \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u0438 \u043E\u0431\xA0\u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0438 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u043E\u0432 \u0438\xA0\u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0441\u0435\u0440\u0432\u0438\u0441\u043E\u0432 \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0430. \u0424\u0430\u0439\u043B\u044B cookie \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u044E\u0442 \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0443 \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u044F\u0442\u044C \u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0443\u044E \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044E \u043F\u043E\xA0\u043C\u0435\u0440\u0435 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F \u0438\u043C\u0438 \u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u043E\u0432 \u0438\xA0\u043C\u043E\u0431\u0438\u043B\u044C\u043D\u044B\u0445 \u0441\u0435\u0440\u0432\u0438\u0441\u043E\u0432 \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0430 (\u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043E\u0442\u043A\u0440\u044B\u0432\u0430\u0442\u044C \u0438\xA0\u0437\u0430\u0433\u0440\u0443\u0436\u0430\u0442\u044C \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0435 \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u044B). \u0412\u0435\u0431-\u043C\u0430\u044F\u043A\u0438 \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u044E\u0442 \u0443\u0437\u043D\u0430\u0432\u0430\u0442\u044C, \u0431\u044B\u043B\u0430\xA0\u043B\u0438 \u043F\u043E\u0441\u0435\u0449\u0435\u043D\u0430 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u0430\u044F \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0430, \u0431\u044B\u043B\u043E\xA0\u043B\u0438 \u043E\u0442\u043A\u0440\u044B\u0442\u043E \u044D\u043B\u0435\u043A\u0442\u0440\u043E\u043D\u043D\u043E\u0435 \u043F\u0438\u0441\u044C\u043C\u043E \u0438\u043B\u0438 \u0431\u044B\u043B\u0438\xA0\u043B\u0438 \u044D\u0444\u0444\u0435\u043A\u0442\u0438\u0432\u043D\u044B \u0440\u0435\u043A\u043B\u0430\u043C\u043D\u044B\u0435 \u0431\u0430\u043D\u043D\u0435\u0440\u044B \u043D\u0430\xA0\u0432\u0435\u0431-\u0441\u0430\u0439\u0442\u0430\u0445 \u041E\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0438\xA0\u0434\u0440\u0443\u0433\u0438\u0445 \u0441\u0430\u0439\u0442\u0430\u0445."
